import React, { useState, useEffect } from 'react'
import { useAppContext } from "../libs/contextLib";
import { onError } from "../libs/errorLib";
import { listPrograms } from '../api';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import Accordion from '@material-ui/core/Accordion';
import AccordionSummary from '@material-ui/core/AccordionSummary';
import AccordionDetails from '@material-ui/core/AccordionDetails';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import { Link } from 'react-router-dom';



function ViewGoals() {
    const { currentClient } = useAppContext();
    const [programs, setPrograms] = useState([]);
    const [goals, setGoals] = useState([]);

    const goalBank = [{
        id: "artic-1",
        description: "Given 20 sounds and a verbal prompt or model, STUDENT will articulate the sound(s) of / / at the isolation level with 80% accuracy in 4 out of 5 opportunities.",
    }];


    useEffect(() => {
        onLoad();
    }, [currentClient]);

    async function onLoad() {
        try {
            if (currentClient != '') {
                setPrograms(await listPrograms(currentClient));
                console.log(programs);
            }
        } catch (e) {
            if (e !== "No programs") {
                onError(e);
            }
        }

    }

    /*componentDidMount = async () => {

    }*/
    return (
        <div style={{ flexGrow: 1 }}>
            <Paper style={{ padding: '1rem' }}>
                <Typography variant="h4">Browse &amp; Add Goals</Typography>
                <Container>
                    <Accordion>
                        <AccordionSummary
                            expandIcon={<ExpandMoreIcon />}
                        >
                            <Typography variant="h6">Articulation</Typography>
                        </AccordionSummary>
                        <AccordionDetails>
                            <Grid container spacing={3}>
                                {goalBank.map((goal) => {
                                    <Grid item sm={4}>
                                        <Card style={{ padding: 2, textAlign: 'center' }}>
                                            <CardContent>
                                                <TableContainer>
                                                    <Table>
                                                        <TableHead>
                                                            <TableRow>
                                                                <TableCell align="left">{goal.description}</TableCell>
                                                            </TableRow>
                                                        </TableHead>
                                                        <TableBody>
                                                            <TableRow>
                                                                <TableCell align="left">Uliana Y.</TableCell>
                                                                <TableCell align="right" style={{ fontWeight: '600' }}>Nov. 27, 2020</TableCell>
                                                            </TableRow>
                                                        </TableBody>
                                                    </Table>
                                                </TableContainer>
                                            </CardContent>
                                        </Card>
                                    </Grid>
                                })}
                            </Grid>
                        </AccordionDetails>
                    </Accordion>
                </Container>
            </Paper>
        </div>
    )
}

export default ViewGoals
